The previous models primarily focus on self-interest and fairness considerations, often using proportional fairness as a reference point.  However, they lack exploration of potential *social preferences* beyond simple inequity aversion.  Specifically,  models haven't directly addressed the possibility of  altruism or spiteful behavior.  Furthermore, the influence of the *context* (trial type) on the acceptance decision is not fully explored.

This model will incorporate a social preference component alongside self-interest. We will also include a contextual modulation parameter that allows the relative weight of social preferences to vary depending on whether the opponent contributed more or less than the participant.  This allows for a more nuanced understanding of how social factors interplay with self-interest and the context of the game.

The mathematical form will be a weighted sum of self-interest and a social preference term, modulated by a contextual factor.  We will use the absolute difference between the participant's and opponent's proportional shares as a proxy for social preference; a larger difference could trigger either altruism (positive social preference if participant gets less) or spite (negative social preference if the participant gets more).

This model requires two learnable parameters: one for the weight of self-interest and another for the weight of the social preference term. The contextual factor uses the `trial_type` variable to modulate the social preference component.


